def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    """Improved version of `priority_v1`."""
    priorities = np.zeros(len(bins))
    remaining_items = item

    max_capacity = max(bins)

    if item > max_capacity:
        max_capacity_bin_index = np.argmax(bins)
        remaining_items -= bins[max_capacity_bin_index]
        priorities[max_capacity_bin_index] = 1
        if remaining_items <= 0:
            return priorities

    for i in range(len(bins)):
        if bins[i] >= remaining_items:
            priorities[i] = remaining_items / bins[i]
            remaining_items = 0
            break
        else:
            priorities[i] = 1
            remaining_items -= bins[i]

    if remaining_items > 0:
        for j in range(max_capacity_bin_index+1, len(bins)):
            if bins[j] >= remaining_items:
                priorities[j] = remaining_items / bins[j]
                remaining_items = 0
                break
            else:
                priorities[j] = 1
                remaining_items -= bins[j]

    if remaining_items > 0:
        for k in range(len(bins)):
            if bins[k] >= remaining_items:
                priorities[k] += remaining_items / bins[k]
                remaining_items = 0
                break

    return priorities
